/*
DROP TABLE IF EXISTS reviews;
DROP TABLE IF EXISTS scores;
DROP TABLE IF EXISTS films;
DROP TABLE IF EXISTS age_ratings;
DROP TABLE IF EXISTS bans;
DROP TABLE IF EXISTS users;
DROP TABLE IF EXISTS roles;
 */

CREATE TABLE IF NOT EXISTS roles (
    id SMALLSERIAL PRIMARY KEY,
    "name" VARCHAR(10) UNIQUE NOT NULL
);

CREATE TABLE IF NOT EXISTS users (
    id BIGSERIAL PRIMARY KEY,
    email VARCHAR(100) NOT NULL,
    login VARCHAR(100) NOT NULL,
    "password" VARCHAR(40) NOT NULL,
    role_id SMALLINT NOT NULL REFERENCES roles(id),
    info TEXT NOT NULL DEFAULT '',
    avatar TEXT,
    reputation SMALLINT NOT NULL DEFAULT 0,
    registration TIMESTAMPTZ(3)NOT NULL DEFAULT NOW(),
    last_update TIMESTAMPTZ(3) NOT NULL DEFAULT NOW(),
    deleted BOOLEAN NOT NULL DEFAULT FALSE
);

CREATE TABLE IF NOT EXISTS bans (
    id BIGSERIAL PRIMARY KEY,
    user_id BIGINT NOT NULL REFERENCES users(id),
    admin_id BIGINT NOT NULL REFERENCES users(id),
    start_date TIMESTAMPTZ(3) NOT NULL,
    end_date TIMESTAMPTZ(3) NOT NULL,
    reason TEXT NOT NULL,
    last_update TIMESTAMPTZ(3) NOT NULL DEFAULT NOW(),
    deleted BOOLEAN NOT NULL DEFAULT FALSE
);

CREATE TABLE IF NOT EXISTS age_ratings (
    id SMALLSERIAL PRIMARY KEY,
    "name" VARCHAR(10) UNIQUE NOT NULL
);

CREATE TABLE IF NOT EXISTS films (
    id BIGSERIAL PRIMARY KEY,
    title TEXT NOT NULL,
    description TEXT NOT NULL DEFAULT '',
    release_year SMALLINT NOT NULL,
    "length" SMALLINT NOT NULL,
    poster TEXT,
    age_rating_id SMALLINT NOT NULL REFERENCES age_ratings(id),
    last_update TIMESTAMPTZ(3) NOT NULL DEFAULT NOW(),
    deleted BOOLEAN NOT NULL DEFAULT FALSE
);

CREATE TABLE IF NOT EXISTS scores (
    id BIGSERIAL PRIMARY KEY,
    film_id BIGINT NOT NULL REFERENCES films(id),
    user_id BIGINT NOT NULL REFERENCES users(id),
    value SMALLINT NOT NULL,
    publication_date TIMESTAMPTZ(3) NOT NULL DEFAULT NOW(),
    last_update TIMESTAMPTZ(3) NOT NULL DEFAULT NOW(),
    deleted BOOLEAN NOT NULL DEFAULT FALSE
);

CREATE TABLE IF NOT EXISTS reviews (
    id BIGSERIAL PRIMARY KEY,
    film_id BIGINT NOT NULL REFERENCES films(id),
    user_id BIGINT NOT NULL REFERENCES users(id),
    "content" TEXT NOT NULL,
    publication_date TIMESTAMPTZ(3) NOT NULL DEFAULT NOW(),
    last_update TIMESTAMPTZ(3) NOT NULL DEFAULT NOW(),
    deleted BOOLEAN NOT NULL DEFAULT FALSE
);

